import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Step 1: Wait for product cards to be rendered by the script and click the first one
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.locator('.product-card').first().click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_clicked.png'));

    // Step 2: Wait for the product detail modal to appear
    await page.waitForSelector('.product-detail', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_visible.png'));

    // Step 3: Click the "Add to Wish List" button inside the modal
    await page.locator('button.add-to-wishlist').click();

    // Step 4: Wait for the success notification
    await page.waitForSelector('.notification.success', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_wishlist_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_wishlist_added.png'));

    // Step 5: Extract data to verify the action
    const notificationText = await page.locator('.notification.success').textContent();
    const wishlistItems = await page.evaluate(() => {
      const data = localStorage.getItem('amazonWishlist');
      return data ? JSON.parse(data) : [];
    });

    return {
      success: true,
      action: "Successfully added a product to the wishlist.",
      extractedData: {
        notificationMessage: notificationText.trim(),
        wishlistCount: wishlistItems.length,
        firstItemTitle: wishlistItems.length > 0 ? wishlistItems[0].title : null,
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add product to wishlist",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
